	def process_queue(self):
		"""
		Processes tasks in queue, marks them as done and dequeues them.

		"""
		while True:
			try:
				item = self.queue.get(timeout=0.1, block=False)
				if item:
					try:
						self.process_task(item)
					except ValueError as e:
						raise e
					finally:
						self.queue.task_done()
			except Empty as e:
				raise e

	def process_task(self, item):
		"""
		Sends tasks to redis if it's not down, otherwise it retries 3 times.
		Even after retries, if it fails to push task to redis,
		it raises OperationalError exception
		"""
		task_name = item["task_name"]
		for retry in range(3):
			try:
				return task_name.apply_async()
			except OperationalError as e:
				if retry == 2:
					raise e
				sleep(2) # Can be modified according to requirement
We have created a consumer, which inherits from Thread, so the consumer runs on a different thread from MainThread. process_task and process_queue are self explanatory, so let's talk about other properties/functions.run() - We are overriding Thread's run function, to indefinitely run this consumer and consume tasks from the in memory queue. Once thread is started, run functiontakes control.self.daemon=True - This means that the thread will be running in the background and in a non-blocking way with respect to MainThread.task_name.apply_async() - This is simply sending task to Redis , otherwise you can execute a normal task here as well by replace this to task_name() .Finally! Everything seems to be in place, now we just need to tell client to run this consumer
